import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import Header from '../sharedpages/header';
import Navbar from '../sharedpages/navbar';
import Footer from '../sharedpages/footer';
import './bookmarks.css';

// Export bookmark data for use in other components
export const bookmarkedAddresses = [
  {
    id: 1,
    address: '123 Jurong East Ave 1, Singapore 600123',
    type: 'Industrial Property',
    propertyType: 'Industrial Property',
    floorArea: '5000',
    level: 'Ground Floor',
    unit: 'A-01',
    estimatedValue: '$2.9M',
    mapImage: 'https://images.unsplash.com/photo-1586528116311-ad8dd3c8310d?w=300&h=200&fit=crop'
  },
  {
    id: 2,
    address: '456 Tuas South Ave 2, Singapore 637456',
    type: 'Factory Building',
    propertyType: 'Factory Building',
    floorArea: '8000',
    level: 'Level 1',
    unit: 'B-15',
    estimatedValue: '$1.5M',
    mapImage: 'https://images.unsplash.com/photo-1560472354-b33ff0c44a43?w=300&h=200&fit=crop'
  },
  {
    id: 3,
    address: '789 Woodlands Industrial Park, Singapore 738789',
    type: 'Warehouse',
    propertyType: 'Warehouse',
    floorArea: '12000',
    level: 'Ground Floor',
    unit: 'C-03',
    estimatedValue: '$3.2M',
    mapImage: 'https://images.unsplash.com/photo-1497366216548-37526070297c?w=300&h=200&fit=crop'
  },
  {
    id: 4,
    address: '321 Changi Business Park, Singapore 486321',
    type: 'Office Space',
    propertyType: 'Office Space',
    floorArea: '3000',
    level: 'Level 3',
    unit: 'D-22',
    estimatedValue: '$2.1M',
    mapImage: 'https://images.unsplash.com/photo-1497366216548-37526070297c?w=300&h=200&fit=crop'
  },
  {
    id: 5,
    address: '654 Pasir Panjang Terminal, Singapore 118654',
    type: 'Commercial Space',
    propertyType: 'Commercial Space',
    floorArea: '6000',
    level: 'Ground Floor',
    unit: 'E-05',
    estimatedValue: '$4.5M',
    mapImage: 'https://images.unsplash.com/photo-1586528116311-ad8dd3c8310d?w=300&h=200&fit=crop'
  }
];

export const bookmarkedPredictions = [
  {
    id: 1,
    address: '123 Jurong East Ave 1, Singapore 600123',
    propertyType: 'Industrial Property',
    prediction: 'Sales Prediction: $2.9M',
    estimatedValue: '$2.9M',
    floorArea: '5000',
    level: 'Ground Floor',
    unit: 'A-01',
    bookmarkedDate: '2024-01-15',
    image: 'https://images.unsplash.com/photo-1586528116311-ad8dd3c8310d?w=300&h=200&fit=crop'
  },
  {
    id: 2,
    address: '456 Tuas South Ave 2, Singapore 637456',
    propertyType: 'Factory Building',
    prediction: 'Sales Prediction: $1.5M',
    estimatedValue: '$1.5M',
    floorArea: '8000',
    level: 'Level 1',
    unit: 'B-15',
    bookmarkedDate: '2024-02-20',
    image: 'https://images.unsplash.com/photo-1560472354-b33ff0c44a43?w=300&h=200&fit=crop'
  },
  {
    id: 3,
    address: '789 Woodlands Industrial Park, Singapore 738789',
    propertyType: 'Warehouse',
    prediction: 'Sales Prediction: $3.2M',
    estimatedValue: '$3.2M',
    floorArea: '12000',
    level: 'Ground Floor',
    unit: 'C-03',
    bookmarkedDate: '2024-03-10',
    image: 'https://images.unsplash.com/photo-1497366216548-37526070297c?w=300&h=200&fit=crop'
  }
];

export const bookmarkedComparisons = [
  {
    id: 1,
    title: 'Jurong East vs. Tuas',
    description: 'Comparison of industrial property values and trends in Jurong East and Tuas areas.',
    address1: '123 Jurong East Ave 1, Singapore 600123',
    address2: '456 Tuas South Ave 2, Singapore 637456',
    propertyType: 'Industrial Property',
    bookmarkedDate: '2024-04-05',
    image: 'https://images.unsplash.com/photo-1449824913935-59a10b8d2000?w=300&h=200&fit=crop'
  },
  {
    id: 2,
    title: 'Woodlands vs. Changi',
    description: 'Comparison of warehouse and office space values in Woodlands Industrial Park and Changi Business Park.',
    address1: '789 Woodlands Industrial Park, Singapore 738789',
    address2: '321 Changi Business Park, Singapore 486321',
    propertyType: 'Mixed Use',
    bookmarkedDate: '2024-05-12',
    image: 'https://images.unsplash.com/photo-1507525428034-b723cf961d3e?w=300&h=200&fit=crop'
  },
  {
    id: 3,
    title: 'Pasir Panjang vs. Jurong East',
    description: 'Comparison of commercial space values and rental yields in Pasir Panjang Terminal and Jurong East.',
    address1: '654 Pasir Panjang Terminal, Singapore 118654',
    address2: '123 Jurong East Ave 1, Singapore 600123',
    propertyType: 'Commercial Space',
    bookmarkedDate: '2024-06-20',
    image: 'https://images.unsplash.com/photo-1564013799919-ab600027ffc6?w=300&h=200&fit=crop'
  }
];

const Bookmarks = () => {
  const [activeTab, setActiveTab] = useState('bookmarks');
  const navigate = useNavigate();

  // State for bookmarks - will be loaded from localStorage
  const [bookmarkedAddresses, setBookmarkedAddresses] = useState([
    {
      id: 1,
      address: '123 Jurong East Ave 1, Singapore 600123',
      type: 'Industrial Property',
      propertyType: 'Industrial Property',
      floorArea: '5000',
      level: 'Ground Floor',
      unit: 'A-01',
      estimatedValue: '$2.9M',
      mapImage: 'https://images.unsplash.com/photo-1586528116311-ad8dd3c8310d?w=300&h=200&fit=crop'
    },
    {
      id: 2,
      address: '456 Tuas South Ave 2, Singapore 637456',
      type: 'Factory Building',
      propertyType: 'Factory Building',
      floorArea: '8000',
      level: 'Level 1',
      unit: 'B-15',
      estimatedValue: '$1.5M',
      mapImage: 'https://images.unsplash.com/photo-1560472354-b33ff0c44a43?w=300&h=200&fit=crop'
    },
    {
      id: 3,
      address: '789 Woodlands Industrial Park, Singapore 738789',
      type: 'Warehouse',
      propertyType: 'Warehouse',
      floorArea: '12000',
      level: 'Ground Floor',
      unit: 'C-03',
      estimatedValue: '$3.2M',
      mapImage: 'https://images.unsplash.com/photo-1497366216548-37526070297c?w=300&h=200&fit=crop'
    },
    {
      id: 4,
      address: '321 Changi Business Park, Singapore 486321',
      type: 'Office Space',
      propertyType: 'Office Space',
      floorArea: '3000',
      level: 'Level 3',
      unit: 'D-22',
      estimatedValue: '$2.1M',
      mapImage: 'https://images.unsplash.com/photo-1497366216548-37526070297c?w=300&h=200&fit=crop'
    },
    {
      id: 5,
      address: '654 Pasir Panjang Terminal, Singapore 118654',
      type: 'Commercial Space',
      propertyType: 'Commercial Space',
      floorArea: '6000',
      level: 'Ground Floor',
      unit: 'E-05',
      estimatedValue: '$4.5M',
      mapImage: 'https://images.unsplash.com/photo-1586528116311-ad8dd3c8310d?w=300&h=200&fit=crop'
    }
  ]);

  const [bookmarkedPredictions, setBookmarkedPredictions] = useState([
    {
      id: 1,
      address: '123 Jurong East Ave 1, Singapore 600123',
      propertyType: 'Industrial Property',
      prediction: 'Sales Prediction: $2.9M',
      estimatedValue: '$2.9M',
      floorArea: '5000',
      level: 'Ground Floor',
      unit: 'A-01',
      bookmarkedDate: '2024-01-15',
      image: 'https://images.unsplash.com/photo-1586528116311-ad8dd3c8310d?w=300&h=200&fit=crop'
    },
    {
      id: 2,
      address: '456 Tuas South Ave 2, Singapore 637456',
      propertyType: 'Factory Building',
      prediction: 'Sales Prediction: $1.5M',
      estimatedValue: '$1.5M',
      floorArea: '8000',
      level: 'Level 1',
      unit: 'B-15',
      bookmarkedDate: '2024-02-20',
      image: 'https://images.unsplash.com/photo-1560472354-b33ff0c44a43?w=300&h=200&fit=crop'
    },
    {
      id: 3,
      address: '789 Woodlands Industrial Park, Singapore 738789',
      propertyType: 'Warehouse',
      prediction: 'Sales Prediction: $3.2M',
      estimatedValue: '$3.2M',
      floorArea: '12000',
      level: 'Ground Floor',
      unit: 'C-03',
      bookmarkedDate: '2024-03-10',
      image: 'https://images.unsplash.com/photo-1497366216548-37526070297c?w=300&h=200&fit=crop'
    }
  ]);

  const [bookmarkedComparisons, setBookmarkedComparisons] = useState([
    {
      id: 1,
      title: 'Jurong East vs. Tuas',
      description: 'Comparison of industrial property values and trends in Jurong East and Tuas areas.',
      address1: '123 Jurong East Ave 1, Singapore 600123',
      address2: '456 Tuas South Ave 2, Singapore 637456',
      propertyType: 'Industrial Property',
      bookmarkedDate: '2024-04-05',
      image: 'https://images.unsplash.com/photo-1449824913935-59a10b8d2000?w=300&h=200&fit=crop'
    },
    {
      id: 2,
      title: 'Woodlands vs. Changi',
      description: 'Comparison of warehouse and office space values in Woodlands Industrial Park and Changi Business Park.',
      address1: '789 Woodlands Industrial Park, Singapore 738789',
      address2: '321 Changi Business Park, Singapore 486321',
      propertyType: 'Mixed Use',
      bookmarkedDate: '2024-05-12',
      image: 'https://images.unsplash.com/photo-1507525428034-b723cf961d3e?w=300&h=200&fit=crop'
    },
    {
      id: 3,
      title: 'Pasir Panjang vs. Jurong East',
      description: 'Comparison of commercial space values and rental yields in Pasir Panjang Terminal and Jurong East.',
      address1: '654 Pasir Panjang Terminal, Singapore 118654',
      address2: '123 Jurong East Ave 1, Singapore 600123',
      propertyType: 'Commercial Space',
      bookmarkedDate: '2024-06-20',
      image: 'https://images.unsplash.com/photo-1564013799919-ab600027ffc6?w=300&h=200&fit=crop'
    }
  ]);

  // Mock user type - in real app, this would come from user context/auth
  // Set to false to test free user view (Bookmarked Comparisons section will be hidden)
  const isPremiumUser = true;

  // Load bookmarks from localStorage on component mount
  useEffect(() => {
    // Load bookmarked addresses
    const savedAddresses = localStorage.getItem('bookmarkedAddresses');
    if (savedAddresses) {
      try {
        const parsed = JSON.parse(savedAddresses);
        if (Array.isArray(parsed) && parsed.length > 0) {
          setBookmarkedAddresses(parsed);
        }
      } catch (error) {
        console.error('Error parsing saved addresses:', error);
      }
    } else {
      // Save initial addresses to localStorage
      localStorage.setItem('bookmarkedAddresses', JSON.stringify(bookmarkedAddresses));
    }

    // Load bookmarked predictions
    const savedPredictions = localStorage.getItem('bookmarkedPredictions');
    if (savedPredictions) {
      try {
        const parsed = JSON.parse(savedPredictions);
        if (Array.isArray(parsed) && parsed.length > 0) {
          setBookmarkedPredictions(parsed);
        }
      } catch (error) {
        console.error('Error parsing saved predictions:', error);
      }
    } else {
      // Save initial predictions to localStorage
      localStorage.setItem('bookmarkedPredictions', JSON.stringify(bookmarkedPredictions));
    }

    // Load bookmarked comparisons
    const savedComparisons = localStorage.getItem('bookmarkedComparisons');
    if (savedComparisons) {
      try {
        const parsed = JSON.parse(savedComparisons);
        if (Array.isArray(parsed) && parsed.length > 0) {
          setBookmarkedComparisons(parsed);
        }
      } catch (error) {
        console.error('Error parsing saved comparisons:', error);
      }
    } else {
      // Save initial comparisons to localStorage
      localStorage.setItem('bookmarkedComparisons', JSON.stringify(bookmarkedComparisons));
    }
  }, []);

  // Navigation handlers for bookmark items
  const handleAddressClick = (address) => {
    navigate('/dashboard/priceprediction', { 
      state: { 
        prefillAddress: address.address,
        prefillPropertyType: address.propertyType,
        fromBookmark: true 
      } 
    });
  };

  const handlePredictionClick = (prediction) => {
    navigate('/dashboard/prediction', { 
      state: { 
        searchData: {
          address: prediction.address,
          propertyType: prediction.propertyType,
          floorArea: prediction.floorArea,
          level: prediction.level,
          unit: prediction.unit
        },
        fromBookmark: true 
      } 
    });
  };

  const handleComparisonClick = (comparison) => {
    // Navigate directly to comparison results page
    navigate('/dashboard/comparison', { 
      state: { 
        properties: [
          {
            id: Date.now(),
            propertyType: comparison.propertyType || 'Industrial Property',
            address: comparison.address1,
            floorArea: '1500',
            level: 'Ground Floor',
            unit: 'A-01'
          },
          {
            id: Date.now() + 1,
            propertyType: comparison.propertyType || 'Commercial Space',
            address: comparison.address2,
            floorArea: '2000',
            level: 'Level 1',
            unit: 'B-15'
          }
        ],
        fromBookmark: true 
      } 
    });
  };

  // Function to add new bookmarks (useful for testing or future functionality)
  const addBookmark = (type, bookmarkData) => {
    const newId = Date.now();
    const newBookmark = { ...bookmarkData, id: newId };
    
    switch (type) {
      case 'address':
        const updatedAddresses = [newBookmark, ...bookmarkedAddresses];
        setBookmarkedAddresses(updatedAddresses);
        localStorage.setItem('bookmarkedAddresses', JSON.stringify(updatedAddresses));
        console.log(`✅ New address bookmark added: ${bookmarkData.address}`);
        break;
      case 'prediction':
        const updatedPredictions = [newBookmark, ...bookmarkedPredictions];
        setBookmarkedPredictions(updatedPredictions);
        localStorage.setItem('bookmarkedPredictions', JSON.stringify(updatedPredictions));
        console.log(`✅ New prediction bookmark added: ${bookmarkData.address}`);
        break;
      case 'comparison':
        const updatedComparisons = [newBookmark, ...bookmarkedComparisons];
        setBookmarkedComparisons(updatedComparisons);
        localStorage.setItem('bookmarkedComparisons', JSON.stringify(updatedComparisons));
        console.log(`✅ New comparison bookmark added: ${bookmarkData.title}`);
        break;
      default:
        console.log(`Unknown bookmark type: ${type}`);
    }
  };

  const handleRemoveBookmark = (type, id) => {
    // Get the item details for confirmation message
    let itemName = '';
    let itemType = '';
    
    switch (type) {
      case 'address':
        const addressItem = bookmarkedAddresses.find(addr => addr.id === id);
        itemName = addressItem?.address || 'this address';
        itemType = 'address';
        break;
      case 'prediction':
        const predictionItem = bookmarkedPredictions.find(pred => pred.id === id);
        itemName = predictionItem?.address || 'this prediction';
        itemType = 'prediction';
        break;
      case 'comparison':
        const comparisonItem = bookmarkedComparisons.find(comp => comp.id === id);
        itemName = comparisonItem?.title || 'this comparison';
        itemType = 'comparison';
        break;
      default:
        console.log(`Unknown bookmark type: ${type}`);
        return;
    }
    
    // Show confirmation dialog
    const isConfirmed = window.confirm(`Are you sure you want to remove "${itemName}" from your bookmarks?`);
    
    if (isConfirmed) {
      switch (type) {
        case 'address':
          const updatedAddresses = bookmarkedAddresses.filter(addr => addr.id !== id);
          setBookmarkedAddresses(updatedAddresses);
          localStorage.setItem('bookmarkedAddresses', JSON.stringify(updatedAddresses));
          console.log(`✅ Bookmarked address "${itemName}" removed successfully`);
          break;
        case 'prediction':
          const updatedPredictions = bookmarkedPredictions.filter(pred => pred.id !== id);
          setBookmarkedPredictions(updatedPredictions);
          localStorage.setItem('bookmarkedPredictions', JSON.stringify(updatedPredictions));
          console.log(`✅ Bookmarked prediction "${itemName}" removed successfully`);
          break;
        case 'comparison':
          const updatedComparisons = bookmarkedComparisons.filter(comp => comp.id !== id);
          setBookmarkedComparisons(updatedComparisons);
          localStorage.setItem('bookmarkedComparisons', JSON.stringify(updatedComparisons));
          console.log(`✅ Bookmarked comparison "${itemName}" removed successfully`);
          break;
        default:
          console.log(`Unknown bookmark type: ${type}`);
      }
    }
  };

  return (
    <div className="user-dashboard">
      {/* Top Header */}
      <Header />

      <div className="user-dashboard-container">
        {/* Left Sidebar */}
        <Navbar activeTab={activeTab} setActiveTab={setActiveTab} />

        {/* Main Content */}
        <main className="user-main-content">
          <div className="user-content-header">
            <h1 className="user-main-title">My Bookmarks</h1>
          </div>

          {/* Bookmarked Addresses */}
          <section className="bookmarked-addresses">
            <h2 className="bookmarks-section-title">Bookmarked Addresses</h2>
            <div className="bookmarks-grid">
              {bookmarkedAddresses.map((address) => (
                <div 
                  key={address.id} 
                  className="bookmark-card address-card clickable"
                  onClick={() => handleAddressClick(address)}
                  title="Click to view price prediction"
                >
                  <div className="card-map">
                    <img src={address.mapImage} alt={address.address} />
                    <button 
                      className="remove-bookmark-btn"
                      onClick={(e) => {
                        e.stopPropagation();
                        handleRemoveBookmark('address', address.id);
                      }}
                      title="Remove bookmark"
                    >
                      ✕
                    </button>
                  </div>
                  <div className="card-content">
                    <h3 className="card-address">{address.address}</h3>
                    <p className="card-type">{address.type}</p>
                    <p className="card-details">Floor Area: {address.floorArea} sq ft | Level: {address.level}</p>
                    {address.unit && <p className="card-unit">Unit: {address.unit}</p>}
                    <p className="card-hint">💡 Click to get price prediction</p>
                  </div>
                </div>
              ))}
            </div>
          </section>

          {/* Bookmarked Predictions */}
          <section className="bookmarked-predictions">
            <h2 className="bookmarks-section-title">Bookmarked Predictions</h2>
            <div className="bookmarks-grid">
              {bookmarkedPredictions.map((prediction) => (
                <div 
                  key={prediction.id} 
                  className="bookmark-card prediction-card clickable"
                  onClick={() => handlePredictionClick(prediction)}
                  title="Click to view prediction details"
                >
                  <div className="card-image">
                    <img src={prediction.image} alt={prediction.address} />
                    <button 
                      className="remove-bookmark-btn"
                      onClick={(e) => {
                        e.stopPropagation();
                        handleRemoveBookmark('prediction', prediction.id);
                      }}
                      title="Remove bookmark"
                    >
                      ✕
                    </button>
                  </div>
                  <div className="card-content">
                    <h3 className="card-address">{prediction.address}</h3>
                    <p className="card-prediction">{prediction.prediction}</p>
                    <p className="card-details">Property Type: {prediction.propertyType}</p>
                    <p className="card-details">Floor Area: {prediction.floorArea} sq ft | Level: {prediction.level}</p>
                    {prediction.unit && <p className="card-unit">Unit: {prediction.unit}</p>}
                    <p className="card-date">Bookmarked on {prediction.bookmarkedDate}</p>
                    <p className="card-hint">💡 Click to view prediction details</p>
                  </div>
                </div>
              ))}
            </div>
          </section>

          {/* Bookmarked Comparisons - Premium Users Only */}
          {isPremiumUser && (
            <section className="bookmarked-comparisons">
              <h2 className="bookmarks-section-title">Bookmarked Comparisons</h2>
              <div className="bookmarks-grid">
                {bookmarkedComparisons.map((comparison) => (
                  <div 
                    key={comparison.id} 
                    className="bookmark-card comparison-card clickable"
                    onClick={() => handleComparisonClick(comparison)}
                    title="Click to view comparison results"
                  >
                    <div className="card-image">
                      <img src={comparison.image} alt={comparison.title} />
                      <button 
                        className="remove-bookmark-btn"
                        onClick={(e) => {
                          e.stopPropagation();
                          handleRemoveBookmark('comparison', comparison.id);
                        }}
                        title="Remove bookmark"
                      >
                        ✕
                      </button>
                    </div>
                    <div className="card-content">
                      <h3 className="card-title">{comparison.title}</h3>
                      <p className="card-description">{comparison.description}</p>
                      <p className="card-details">Property Type: {comparison.propertyType}</p>
                      <p className="card-addresses">
                        <strong>Address 1:</strong> {comparison.address1}<br/>
                        <strong>Address 2:</strong> {comparison.address2}
                      </p>
                      <p className="card-date">Bookmarked on {comparison.bookmarkedDate}</p>
                      <p className="card-hint">💡 Click to view comparison results</p>
                    </div>
                  </div>
                ))}
              </div>
            </section>
          )}
        </main>
      </div>

      {/* Footer */}
      <Footer />
    </div>
  );
};

export default Bookmarks;
